import React from 'react';
import { Container, Row, Col } from 'reactstrap';

export default class Content extends React.Component {
  render() {
      var my_result={background:pink,}
    return (
      <Container fluid>
        <Row>
          <Col xs="6">
              <div className="result">
                  <a>Result:_____________near_______________</a>
              </div>
          </Col>
          <Col xs="6">.col-6</Col>
        </Row>
      </Container>
    );
  }
}
